#include <gtest/gtest.h>
#include "solution.h"

TEST(MinimumWindowSubstring, ModifiedLeetCodeSample)
{
    Solution solution;
    solution.minWindow("XBDOAECODEBANC", "ABC");
}

TEST(MinimumWindowSubstring, LeetCodeTest2)
{
    Solution solution;
    solution.minWindow("ask_not_what_your_country_can_do_for_you_ask_what_you_can_do_for_your_country",
                           "ask_country");
}

TEST(MinimumWindowSubstring, LeetCodeTest3)
{
    Solution solution;
    EXPECT_EQ("",
              solution.minWindow("",
                           ""));
}

TEST(MinimumWindowSubstring, LeetCodeTest4)
{
    Solution solution;
    EXPECT_EQ("ba", solution.minWindow("bba", "ab"));
}

TEST(MinimumWindowSubstring, LeetCodeTest5)
{
    Solution solution;
    EXPECT_EQ("cabd", solution.minWindow("abcabdebac", "cda"));
}

TEST(MinimumWindowSubstring, LeetCodeTest6)
{
    Solution solution;
    EXPECT_EQ("", solution.minWindow("bAaaabb", "BAB"));
}

TEST(MinimumWindowSubstring, DISABLED_LeetCodeSample)
{
    Solution solution;
    solution.minWindow("ADOBECODEBANC", "ABC");
}